import UserList from "./components/UserList";
import {BrowserRouter, Routes, route } from "react-router-dom"
function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<UserList/>}/>
      </Routes>
      <UserList/>
    </BrowserRouter>
  );
}

export default App;
